0.html.body:
Introduction
NAVER Maps SDK (hereinafter, “the SDK”) is a map engine that is being used by various NAVER services including NAVER Map application. Being adopted by large services for more than a year, the SDK guarantees useful features and stability. It also provides developer-friendly APIs, allowing you to easily use its powerful features.
Powerful features
The SDK provides powerful features accommodating a variety of requirements of a complicated service like NAVER Maps.
Full vector rendering
The SDK supports full vector rendering, so maps can be enlarged with no deterioration in image quality. Even if a map is tilted or rotated, its symbols are rendered toward the front so that they do not overlap. The SDK also allows you to dynamically change properties displayed on the screen.

Map types and layers
The SDK provides five background map types: basic, satellite, hybrid, terrain, and navigation maps. It also provides six layer groups that can be displayed on background maps: building, live traffic, transit, bicycle, trail, and cadastral layers. Moreover, it provides built-in indoor map features as well as night mode for navigation maps.

Overlays
The SDK provides widely used overlays such as marker, info window, ground, and shape overlays, as well as more specialized overlays such as location, path, and arrow overlays. Markers especially provide more powerful features, such as caption, subcaption and overlap control.

Natural gestures
The SDK supports natural gestures following movements of fingers that manipulate maps. Besides basic gestures including scroll and pinch, it provides various convenient gestures such as double tap, two-finger tap and one-finger zoom. Every gesture is accompanied with fine-tuned inertia effects, which you can adjust yourself.
Powerful event system
Symbols as well as overlays and maps are tappable and can receive an event. The SDK supports more advanced event propagation system, which enables an element covered by another element for which no event handler is added, to receive an event; if the event is not consumed, it is propagated to the map. 
Easy development
With the SDK’s developer-friendly and intuitive APIs, you can easily develop apps.
Compatible with Swift
As all the APIs are provided with nullable annotations, and properties are consistently named, the SDK is well compatible with Swift.
Modern APIs
Adopting the modern API paradigm including immutable objects and enumeration, the SDK provides simple and intuitive code.


    Swift
    Objective-C




        let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
cameraUpdate.reason = 3
cameraUpdate.animation = .fly
cameraUpdate.animationDuration = 2
naverMap.moveCamera(cameraUpdate, completion: { (isCancelled) in
    if isCancelled {
        print("Camera movement failed")
    } else {
        print("Camera movement succeeded")
    }
})





        Swift

          let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
cameraUpdate.reason = 3
cameraUpdate.animation = .fly
cameraUpdate.animationDuration = 2
naverMap.moveCamera(cameraUpdate, completion: { (isCancelled) in
    if isCancelled {
        print("Camera movement failed")
    } else {
        print("Camera movement succeeded")
    }
})




        Objective-C

          NMFCameraUpdate *cameraUpdate = [NMFCameraUpdate cameraUpdateWithScrollTo:NMGLatLngMake(37.5666102, 126.9783881)];
cameraUpdate.reason = 3;
cameraUpdate.animation = NMFCameraUpdateAnimationFly;
cameraUpdate.animationDuration = 2;
[naverMap moveCamera:update completion:^(bool isCancelled) {
    if (isCancelled) {
        NSLog(@"Camera movement failed");
    } else {
        NSLog(@"Camera movement succeeded");
    }
}];






Intuitive APIs
The intuitive API structure helps you create an object if you need one, or add an event handler to the object if you need to deal with an event. 


    Swift
    Objective-C




        let marker = NMFMarker(position: NMGLatLng(lat: 37.5670135, lng: 126.9783740))
marker.touchHandler = { (overlay) in
    print("Marker is clicked")
    return true
}
marker.mapView = naverMap;





        Swift

          let marker = NMFMarker(position: NMGLatLng(lat: 37.5670135, lng: 126.9783740))
marker.touchHandler = { (overlay) in
    print("Marker is clicked")
    return true
}
marker.mapView = naverMap;




        Objective-C

          NMFMarker marker = [NMFMarker markerWithPosition:NMGLatLngMake(37.5670135, 126.9783740)];
marker.touchHandler = ^BOOL(NMFOverlay *overlay) {
    NSLog(@"Marker is clicked");
    return YES;
};
marker.mapView = naverMap;






Quality documentation and demo apps
Developer’s guide, API reference and demo apps are provided to help you use the SDK more easily.

2-1.html.body:
Map Object
A map consists of two elements: View and Interface. The View element displays a map on the screen, and NMFMapView is in charge of this. The Interface element, associated with interfaces used in a map, is handled by the NMFNaverMapView class, which provides most of the UI features.
A map can be displayed with a view. Add an NMFMapView or NMFNaverMapView to the view controller, and a map is displayed on your app screen.
NMFMapView
Add an NMFMapView to your view controller as a sub view, and a map is displayed on the screen. An NMFMapView simply displays a map on the screen. 
The following code example adds an NMFMapView to the view controller to display a map.


    Swift
    Objective-C




        override func viewDidLoad() {
    super.viewDidLoad()

    let mapView = NMFMapView(frame: view.frame)
    view.addSubview(mapView)
}





        Swift

          override func viewDidLoad() {
    super.viewDidLoad()

    let mapView = NMFMapView(frame: view.frame)
    view.addSubview(mapView)
}




        Objective-C

          - (void)viewDidLoad {
    [super viewDidLoad];

    NMFMapView *mapView = [[NMFMapView alloc] initWithFrame:self.view.frame];
    [self.view addSubview:mapView];
}






If you use an Interface Builder such as XIB and storyboard, add a UIView and set NMFMapView in Custom Class.

NMFNaverMapView
You can also add an NMFNaverMapView to display a map on the screen. An NMFNaverMapView has basic UIs for a map, enabling you to easily implement a map app.
You can add it in the same way as the NMFMapView.


    Swift
    Objective-C




        override func viewDidLoad() {
    super.viewDidLoad()

    let naverMapView = NMFNaverMapView(frame: view.frame)
    view.addSubview(naverMapView)
}





        Swift

          override func viewDidLoad() {
    super.viewDidLoad()

    let naverMapView = NMFNaverMapView(frame: view.frame)
    view.addSubview(naverMapView)
}




        Objective-C

          - (void)viewDidLoad {
    [super viewDidLoad];

    NMFNaverMapView *naverMapView = [[NMFNaverMapView alloc] initWithFrame:self.view.frame];
    [self.view addSubview:naverMapView];
}

2-2.html.body:
Coordinates Object
Coordinates are the smallest unit to represent geographical information such as the location of a camera or an overlay. Most APIs associated with maps deal with coordinates or areas as a parameter or return value.
Coordinates
The NAVER Maps SDK adopts the Geographic coordinate system that enables every location on the earth to be specified by a set of latitude and longitude as a default coordinate system, and provides associated features. The SDK also allows several other coordinate systems that can be converted into the default coordinate system.
NMGLatLng
NMGLatLng is a class that represents a set of latitude and longitude. The lat property refers to a latitude, and the lng property refers to a longitude. All properties of the LatLng class can only be specified by a constructor, and properties of the object once created cannot be modified.
The following code example creates an NMGLatLng object and displays a latitude and longitude in the console.


    Swift
    Objective-C




        let coord = NMGLatLng(lat: 37.5670135, lng: 126.9783740)

print("Latitude: \(coord.lat), Longitude: \(coord.lng)")





        Swift

          let coord = NMGLatLng(lat: 37.5670135, lng: 126.9783740)

print("Latitude: \(coord.lat), Longitude: \(coord.lng)")




        Objective-C

          NMGLatLng *coord = NMGLatLngMake(37.5670135, 126.9783740);

NSLog(@"Latitude: %f, Longitude: %f", coord.lat, coord.lng);






Other coordinate systems
The NAVER Maps SDK supports several coordinate systems other than the NMGLatLng. The following coordinate systems are available:

WebMercatorCoord: Coordinates in the Web Mercator coordinate system
Utmk: Coordinates in the UTM-K coordinate system
Tm128: Coordinates in the TM-128 coordinate system

You can converts other coordinates into the LatLng coordinates by using the -toLatLng method of each class, or vice versa by using a constructor that uses an NMGLatLng as a parameter.
The following code example converts NMGUtmk into NMGLatLng.


    Swift
    Objective-C




        let utmk = NMGUtmk(x: 953935.5, y: 1952044.1)
let latLng = utmk.toLatLng()





        Swift

          let utmk = NMGUtmk(x: 953935.5, y: 1952044.1)
let latLng = utmk.toLatLng()




        Objective-C

          NMGUtmk *utmk = NMGUtmkMake(953935.5, 1952044.1);
NMGLatLng *latLng = utmk.toLatLng();






The following code example converts NMGLatLng into NMGUtmk.


    Swift
    Objective-C




        let latLng = NMGLatLng(lat: 37.5666103, lng: 126.9783882)
let utmk = NMGUtmk(from: latLng)





        Swift

          let latLng = NMGLatLng(lat: 37.5666103, lng: 126.9783882)
let utmk = NMGUtmk(from: latLng)




        Objective-C

          NMGLatLng *latLng = NMGLatLngMake(37.5666103, 126.9783882);
NMGUtmk *utmk = [NMGUtmk utmkFromLatLng:latlng];






MBR
With two coordinates representing south-western and north-eastern vertices respectively, you can create a rectangular shaped area. This is known as the Minimum bounding rectangle (MBR). MBRs are the simplest way to define an area, so they are frequently used by the APIs handling areas.
NMGLatLngBounds
NMGLatLngBounds is a class that represents an MBR that consists of a pair of latitude and longitude. The southWest property refers to south west coordinates, and the northEast property refers to north east coordinates. All properties of the NMGLatLngBounds class are readonly, so each of them can be specified by a constructor, and properties of the object once created cannot be modified.
The following code example creates an NMGLatLngBounds object.


    Swift
    Objective-C




        let southWest = NMGLatLng(lat: 31.43, lng: 122.37)
let northEast = NMGLatLng(lat: 44.35, lng: 132)
let bounds = NMGLatLngBounds(southWest: southWest, northEast: northEast)





        Swift

          let southWest = NMGLatLng(lat: 31.43, lng: 122.37)
let northEast = NMGLatLng(lat: 44.35, lng: 132)
let bounds = NMGLatLngBounds(southWest: southWest, northEast: northEast)




        Objective-C

          NMGLatLng *southWest = NMGLatLngMake(31.43, 122.37);
NMGLatLng *northEast = NMGLatLngMake(44.35, 132);
NMGLatLngBounds *bounds = [NMGLatLngBounds latLngBoundsSouthWest:southWest northEast:northEast];

3-1.html.body:
Camera and Projection
The NAVER Maps SDK displays a map in a way of a camera looking at the map on the other side of your screen. By moving, zooming in or out, tilting and rotating the camera, you can move your map as you want.
Camera position
The position of a camera is represented with coordinates of the target position where the camera is located, zoom level, tilt, and bearing of the camera. NMFCameraPosition is a class that represents the position of a camera. All properties of the NMFCameraPosition class are readonly, so each of them can be specified by a constructor, and properties of the object once created cannot be modified.
The following code example creates an NMFCameraPosition object.


    Swift
    Objective-C




        let cameraPosition = NMFCameraPosition()





        Swift

          let cameraPosition = NMFCameraPosition()




        Objective-C

          NMFCameraPosition *cameraPosition = [NMFCameraPosition new];






Target position
target is a property that represents coordinates of the target position where the camera is located. If the target position changes, the map moves in the four cardinal directions.

Zoom level
zoom is a property that represents the zoom level of the camera. The zoom level represents the scale of the map. The smaller the zoom level is, the smaller the scale of the map is, and vice versa. At larger zoom levels, more detailed information is displayed on the map.
Tilt
tilt is a property that represents the viewing angle of the camera. The camera looks down the ground slantingly by the tilt angle. If the tilt angle is 0, the camera vertically looks down the ground; as the tilt angle increases, the camera view is gradually tilted towards the ground. Therefore, the bigger the tilt angle is, the farther the camera can view. If the camera is tilted, the map is shown in perspective mode. That is, based on the center of the map, distant locations become smaller while closer locations become larger.

Heading angle
heading is a property that represents the heading angle of the camera. Heading is the direction in which the camera looks. The heading angle is 0 when the camera faces the north, being measured in degrees clockwise from north. Accordingly, the bearing angle is 90 when the camera faces the east, and 180 when the west.

View and camera
The camera is basically located at the center of the map view. However, content padding affects the position of the camera.
Current camera position
You can call NMFMapView.cameraPosition to get the current position of the camera.
The following code example gets the camera’s current position.


    Swift
    Objective-C




        let cameraPosition = mapView.cameraPosition





        Swift

          let cameraPosition = mapView.cameraPosition




        Objective-C

          CameraPosition *cameraPosition = self.mapView.cameraPosition;






Content padding
You can call NMFMapView.contentInset with a UIEdgeInsets object to specify content padding. When user interfaces are displayed on the map as shown in the figure below, the position of the camera located at the center of the map view does not match the center of the map users actually view.

In this case, you can specify content padding to exclude the area covered by the UI elements. Then, the camera position is located at the center of the remaining area.

The following code example sets 200 px of content padding at the bottom.


    Swift
    Objective-C




        mapView.contentInset = UIEdgeInsets(top: 0, left: 0, bottom: 200, right: 0)





        Swift

          mapView.contentInset = UIEdgeInsets(top: 0, left: 0, bottom: 200, right: 0)




        Objective-C

          self.mapView.contentInset = UIEdgeInsetsMake(0, 0, 200, 0);






Content padding does not change what users actually see. It does, however, change the center of the map where the camera is located, and thus, the position of the camera is changed. 
Projection
The screen uses a coordinate system in pixels based on the upper left point, while the map uses a geographical latitude/longitude coordinate system. Using methods of the NMFProjection class, you can convert between screen pixel coordinates and latitude/longitude coordinates. You cannot directly create an instance of the NMFProjection class, so you should call NMFMapView.projection to get an instance.
The following code example gets an instance of the NMFProjection class.


    Swift
    Objective-C




        let projection = mapView.projection





        Swift

          let projection = mapView.projection




        Objective-C

          NMFProjection *projection = self.mapView.projection;






Conversion between screen coordinates and map coordinates
You can use -latlngFromPoint: to convert screen coordinates into latitude/longitude coordinates, and -pointFromLatLng: to convert latitude/longitude coordinates into screen coordinates.
The following code example converts the screen coordinates, (100, 100) into latitude/longitude coordinates.


    Swift
    Objective-C




        let coord = projection.latlng(from: CGPoint(x: 100, y: 100))





        Swift

          let coord = projection.latlng(from: CGPoint(x: 100, y: 100))




        Objective-C

          NMGLatLng *coord = [projection latlngFromPoint:CGPointMake(100, 100)];






The following code example converts the latitude/longitude coordinates on the map, (37.5666102, 126.9783881) into the screen coordinates.


    Swift
    Objective-C




        let point = projection.point(from: NMGLatLng(lat: 37.5666102, lng: 126.9783881))





        Swift

          let point = projection.point(from: NMGLatLng(lat: 37.5666102, lng: 126.9783881))




        Objective-C

          CGPoint point = [projection pointFromLatLng:NMGLatLngMake(37.5666102, 126.9783881)];






Scale
Since the earth is the shape of a sphere in three dimensions, the earth’s surface cannot be represented in two dimensions without distortion. The NAVER Maps SDK uses Web Mercator projection to render a three dimensional ellipsoid of the earth to a two dimensional map surface, causing the scale of the map to change depending on a zoom level as well as latitude. Using metersPerPixel, you can get the scale of the current camera position.
The following code example gets the scale of the current camera position.


    Swift
    Objective-C




        let metersPerPixel = projection.metersPerPixel()





        Swift

          let metersPerPixel = projection.metersPerPixel()




        Objective-C

          CLLocationDistance metersPerPixel = projection.metersPerPixel;






Using -metersPerPixelAtLatitude:zoom:, you can get the scale based on a specified latitude and zoom level, regardless of the current camera position.
The following code example gets the scale based on various latitudes and zoom levels.


    Swift
    Objective-C




        // Equator, zoom level 10
let metersPerPixel1 = projection.metersPerPixel(atLatitude: 0, zoom: 10)

// Latitude 35 degrees, zoom level 10: The scale gets bigger than the equator.
let metersPerPixel2 = projection.metersPerPixel(atLatitude: 35, zoom: 10)

// Latitude 35 degrees, zoom level 14: The scale gets bigger than the zoom level 10.
let metersPerPixel3 = projection.metersPerPixel(atLatitude: 35, zoom: 14)





        Swift

          // Equator, zoom level 10
let metersPerPixel1 = projection.metersPerPixel(atLatitude: 0, zoom: 10)

// Latitude 35 degrees, zoom level 10: The scale gets bigger than the equator.
let metersPerPixel2 = projection.metersPerPixel(atLatitude: 35, zoom: 10)

// Latitude 35 degrees, zoom level 14: The scale gets bigger than the zoom level 10.
let metersPerPixel3 = projection.metersPerPixel(atLatitude: 35, zoom: 14)




        Objective-C

          // Equator, zoom level 10
CLLocationDistance metersPerPixel1 = [projection metersPerPixelAtLatitude:0 zoom:10];

// Latitude 35 degrees, zoom level 10: The scale gets bigger than the equator.
CLLocationDistance metersPerPixel2 = [projection metersPerPixelAtLatitude:35 zoom:10];

// Latitude 35 degrees, zoom level 14: The scale gets bigger than the zoom level 10.
CLLocationDistance metersPerPixel3 = [projection metersPerPixelAtLatitude:35 zoom:14];

3-2.html.body:
Camera Movement
You can move the camera by making API calls or using user gestures. To move the camera by calling an API, you should use the NMFCameraUpdate object and the -moveCamera: method. With various properties of the NMFCameraUpdate, you can specify the camera position, animations, callbacks, and so on.
Move the camera by making API calls
To move the camera, you should first create an NMFCameraUpdate object which determines how a camera moves. NMFCameraUpdate is a class that defines where and how a camera moves. You can create an NMFCameraUpdate object only by using factory methods, which are defined in the NMFCameraUpdate. The list below describes some factory methods.

+cameraUpdateWithPosition:: Moves the position of the camera to the specified CameraPosition.
+cameraUpdateWithScrollTo:: Sets the target point of the camera to the specified coordinates.
+cameraUpdateWithScrollBy:: Moves the target point of the camera up, down, left or right by the specified points.
+cameraUpdateWithZoomTo:: Sets the zoom level of the camera to the specified value.
+cameraUpdateWithFitBounds:: Changes the camera position to the coordinates where the whole area is shown, with the maximum zoom level. 

Make a call to -moveCamera: of the NMFMapView with the created object as a parameter, and the camera moves.
The following code example creates an NMFCameraUpdate object that changes the target point to (37.5666102, 126.9783881), and calls the -moveCamera: method to move the camera.


    Swift
    Objective-C




        let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
mapView.moveCamera(cameraUpdate)





        Swift

          let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
mapView.moveCamera(cameraUpdate)




        Objective-C

          NMFCameraUpdate *cameraUpdate = [NMFCameraUpdate cameraUpdateWithScrollTo:NMGLatLngMake(37.5666102, 126.9783881)];
[self.mapView moveCamera:cameraUpdate];






Animation
Before calling the -moveCamera: by using the NMFCameraUpdate object, you can specify NMFCameraUpdate.animation to animate the camera movement. When an animation is specified, the camera slowly moves to the target point during the specified period of time.
Animation types
Using NMFCameraUpdate.animate, you can animate the camera movement. The animation receives the NMFCameraUpdateAnimation object, which represents animation types, as a parameter. Animation types defined in the NMFCameraUpdateAnimation enum are listed below.

None: Moves without animation. It is the default value.
Linear: Moves at a regular speed.
EaseIn: Naturally accelerates. It is appropriate for moving a short distance.
EaseOut: Naturally decelerates. It is appropriate for moving a short distance.
Fly: Naturally gets smaller and then larger. It is appropriate for moving a long distance.

The following code example adds the EaseIn animation to the camera movement.


    Swift
    Objective-C




        let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
cameraUpdate.animation = .easeIn
mapView.moveCamera(cameraUpdate)





        Swift

          let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
cameraUpdate.animation = .easeIn
mapView.moveCamera(cameraUpdate)




        Objective-C

          NMFCameraUpdate *cameraUpdate = [NMFCameraUpdate cameraUpdateWithScrollTo:NMGLatLngMake(37.5666102, 126.9783881)];
cameraUpdate.animation = NMFCameraUpdateAnimationEaseIn
[self.mapView moveCamera:cameraUpdate];






Duration
By specifying the animationDuration parameter of the NMFCameraUpdate, you can change the duration of animations. Note that if the animation type is NMFCameraUpdateAnimationNone, the duration is ignored. Also note that if the animationDuration is 0, the camera moves without animation although an animation type is specified.
The following code example adds the Fly animation to the camera movement and sets the duration to 1 sec.


    Swift
    Objective-C




        let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
cameraUpdate.animation = .fly
cameraUpdate.animationDuration = 1
mapView.moveCamera(cameraUpdate)





        Swift

          let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
cameraUpdate.animation = .fly
cameraUpdate.animationDuration = 1
mapView.moveCamera(cameraUpdate)




        Objective-C

          NMFCameraUpdate *cameraUpdate = [NMFCameraUpdate cameraUpdateWithScrollTo:NMGLatLngMake(37.5666102, 126.9783881)];
cameraUpdate.animation = NMFCameraUpdateAnimationFly;
cameraUpdate.animationDuration = 1;
[self.mapView moveCamera:cameraUpdate];






If the duration is not specified, the default animation duration of the map applies. You can change the default animation duration, by using the animationDuration property of the NMFMapView.
The following code example changes the default animation duration of the map to 500 ms.


    Swift
    Objective-C




        mapView.animationDuration = 0.5





        Swift

          mapView.animationDuration = 0.5




        Objective-C

          mapView.animationDuration = 0.5f;






Cancel animations
The camera movement animation can be cancelled for a variety of reasons. When you call the -moveCamera: of NMFMapView to start a new camera movement, the previous camera movement is automatically cancelled.
The following code example starts a camera animation with the duration of 2 seconds and 1 second later, starts a new camera movement to cancel the previous camera animation.


    Swift
    Objective-C




        let coord1 = NMGLatLng(lat: 37.5666102, lng: 126.9783881);
let coord2 = NMGLatLng(lat: 37.57000, lng: 126.97618);

// Camera animation for 2 sec.
let cameraUpdate = NMFCameraUpdate(scrollTo: coord1)
cameraUpdate.animation = .easeIn
cameraUpdate.animationDuration = 2
mapView.moveCamera(cameraUpdate)

// 1 sec later, a new camera movement starts and the previous camera animation is cancelled.
DispatchQueue.main.asyncAfter(deadline: .now() + 1) {
    let cameraUpdate = NMFCameraUpdate(scrollTo: coord2)
    cameraUpdate.animation = .easeIn
    mapView.moveCamera(cameraUpdate)
}





        Swift

          let coord1 = NMGLatLng(lat: 37.5666102, lng: 126.9783881);
let coord2 = NMGLatLng(lat: 37.57000, lng: 126.97618);

// Camera animation for 2 sec.
let cameraUpdate = NMFCameraUpdate(scrollTo: coord1)
cameraUpdate.animation = .easeIn
cameraUpdate.animationDuration = 2
mapView.moveCamera(cameraUpdate)

// 1 sec later, a new camera movement starts and the previous camera animation is cancelled.
DispatchQueue.main.asyncAfter(deadline: .now() + 1) {
    let cameraUpdate = NMFCameraUpdate(scrollTo: coord2)
    cameraUpdate.animation = .easeIn
    mapView.moveCamera(cameraUpdate)
}




        Objective-C

          NMGLatLng *coord1 = NMGLatLngMake(37.5666102, 126.9783881);
NMGLatLng *coord2 = NMGLatLngMake(37.57000, 126.97618);

// Camera animation for 2 sec.
NMFCameraUpdate *cameraUpdate = [NMFCameraUpdate cameraUpdateWithScrollTo:coord1];
cameraUpdate.animation = NMFCameraUpdateAnimationEaseIn;
cameraUpdate.animationDuration = 2;
[self.mapView moveCamera:cameraUpdate];

// 1 sec later, a new camera movement starts and the previous camera animation is cancelled.
dispatch_after(dispatch_time(DISPATCH_TIME_NOW, (int64_t)(1.0 * NSEC_PER_SEC)), dispatch_get_main_queue(), ^{
    NMFCameraUpdate *cameraUpdate = [NMFCameraUpdate cameraUpdateWithScrollTo:coord2];
    cameraUpdate.animation = NMFCameraUpdateAnimationEaseIn;
    [self.mapView moveCamera:cameraUpdate];
});






You can also use the -cancelTransitions of NMFMapView to explicitly cancel the camera animation. When this method is invoked, the current camera animation is cancelled and the camera stops at the current position. With the stop gesture enabled, if a user taps the map, the same result occurs.
The following code example calls -cancelTransitions to cancel the camera animation.


    Swift
    Objective-C




        // Camera animation for 2 sec.
let cameraUpdate = NMFCameraUpdate(scrollTo: coord1)
cameraUpdate.animation = .easeIn
cameraUpdate.animationDuration = 2
mapView.moveCamera(cameraUpdate)

// 1 sec later, cancelTransitions() is called and the previous camera animation is cancelled.
DispatchQueue.main.asyncAfter(deadline: .now() + 1) {
    mapView.cancelTransitions()
}





        Swift

          // Camera animation for 2 sec.
let cameraUpdate = NMFCameraUpdate(scrollTo: coord1)
cameraUpdate.animation = .easeIn
cameraUpdate.animationDuration = 2
mapView.moveCamera(cameraUpdate)

// 1 sec later, cancelTransitions() is called and the previous camera animation is cancelled.
DispatchQueue.main.asyncAfter(deadline: .now() + 1) {
    mapView.cancelTransitions()
}




        Objective-C

          // Camera animation for 2 sec.
NMFCameraUpdate *cameraUpdate = [NMFCameraUpdate cameraUpdateWithScrollTo:coord1];
cameraUpdate.animation = NMFCameraUpdateAnimationEaseIn;
cameraUpdate.animationDuration = 2;
[self.mapView moveCamera:cameraUpdate];

// 1 sec later, cancelTransitions() is called and the previous camera animation is cancelled.
dispatch_after(dispatch_time(DISPATCH_TIME_NOW, (int64_t)(1.0 * NSEC_PER_SEC)), dispatch_get_main_queue(), ^{
    [self.mapView cancelTransitions];
});






Callback and event
With the completion block of -moveCamera:completion:, instead of -moveCamera:, you can get a result called back for a camera movement. You can also add a delegate to the NMFMapView to get events for all camera movements in your map.
Camera movement callback
Implement a callback block with -moveCamera:completion:, and you can get a callback when a camera movement for the NMFCameraUpdate is completed or cancelled. If an animation set for camera movements is cancelled, the isCancelled parameter of the completion block is set to YES; otherwise, it is set to NO. In other words, if no animation is set for camera movements, a camera movement is always considered to be successfully finished.
The following code example sets a callback that displays toast messages when a camera movement is finished or cancelled.


    Swift
    Objective-C




        let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
cameraUpdate.animation = .easeIn
cameraUpdate.animationDuration = 2
mapView.moveCamera(cameraUpdate) { (isCancelled) in
    if isCancelled {
        print("Camera movement cancelled")
    } else {
        print("Camera movement finished")
    }
}





        Swift

          let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
cameraUpdate.animation = .easeIn
cameraUpdate.animationDuration = 2
mapView.moveCamera(cameraUpdate) { (isCancelled) in
    if isCancelled {
        print("Camera movement cancelled")
    } else {
        print("Camera movement finished")
    }
}




        Objective-C

          NMFCameraUpdate *cameraUpdate = [NMFCameraUpdate cameraUpdateWithScrollTo:NMGLatLngMake(37.5666102, 126.9783881)];
cameraUpdate.animation = NMFCameraUpdateAnimationEaseIn;
cameraUpdate.animationDuration = 2;
[self.mapView moveCamera:cameraUpdate completion:^(bool isCancelled) {
    if (isCancelled) {
        NSLog(@"Camera movement cancelled");
    } else {
        NSLog(@"Camera movement finished");
    }
}];






Camera change event
For whatever reason, if a camera moves, an event occurs. Declare an NMFMapViewDelegate protocol in the view controller that is using the NMFMapView and add it with the NMFMapView.delegate method, and you can receive a camera change event. When the camera’s position is changed, the -mapViewRegionIsChanging:byReason: callback method is called.
The reason and animated parameters are passed to the -mapView:regionWillChangeAnimated:byReason: method that is called before the camera movement begins, and the -mapView:regionDidChangeAnimated:byReason: method that is called after the camera movement is completed. The reason parameter is a reason for the camera movement that triggers an event. You can call NMFCameraUpdate.reason to specify a camera movement reason, which can be used by the event listener to determine why an event occurred. The parameter has a pre-defined negative number if the camera movement is made by the NAVER Maps SDK’s embedded features including gestures and controls; you can also define a positive number for other reasons. Pre-defined reasons are as follows:

NMFMapChangedByDeveloper: Indicates that the camera moved by the developer’s API call. It is the default value.
NMFMapChangedByGesture: Indicates that the camera moved in response to a user’s gesture.
NMFMapChangedByControl: Indicates that the camera moved in response to a user’s button tapping.
NMFMapChangedByLocation: Indicates that the camera moved by the location tracking feature.

The following code example adds a delegate method that logs reasons for camera changes and sets a reason to move the camera.


    Swift
    Objective-C




        func mapViewRegionIsChanging(_ mapView: NMFMapView, byReason reason: Int) {
    print("Camera change - reason: \(reason)")
}

let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
cameraUpdate.animation = .easeIn
cameraUpdate.animationDuration = 2
cameraUpdate.reason = 1000

mapView.moveCamera(cameraUpdate)





        Swift

          func mapViewRegionIsChanging(_ mapView: NMFMapView, byReason reason: Int) {
    print("Camera change - reason: \(reason)")
}

let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
cameraUpdate.animation = .easeIn
cameraUpdate.animationDuration = 2
cameraUpdate.reason = 1000

mapView.moveCamera(cameraUpdate)




        Objective-C

          - (void)mapViewRegionIsChanging:(NMFMapView *)mapView byReason:(NSInteger)reason {
    NSLog(@"Camera change - reason : %ld", (long)reason);
}

NMFCameraUpdate *cameraUpdate = [NMFCameraUpdate cameraUpdateWithScrollTo:NMGLatLngMake(37.5666102, 126.9783881)];
cameraUpdate.animation = NMFCameraUpdateAnimationEaseIn;
cameraUpdate.animationDuration = 2;
cameraUpdate.reason = 1000;

[self.mapView moveCamera:cameraUpdate];






Pivot
The NMFCameraUpdate.pivot property specifies a pivot point. A pivot point is a proportion value where the top left of the screen is (0, 0), and the bottom right is (1, 1). It is the point on the screen, based on which the camera moves. When a pivot point is set, the movement, zoom level change and rotation of the camera are performed based on the point, rather than the center of the screen.
For example, if you set the pivot point to (0.5, 0.8) and move the camera, the camera is located at the coordinates of the (0.5, 0.8) point after the camera movement is done. If you zoom in the map with the same pivot point, the map zooms in based on (0.5, 0.8), rather than the center of the map. Therefore, the pivot point can make the camera location after the camera movement different from the specified target location.
Considering that the pivot sets a point where the camera should be located on the screen, it works the same as content padding. However, unlike content padding, the property of NMFMapView, the pivot is the property of NMFCameraUpdate and thus only applies to one camera change, and does not permanently affect the map object.
The following code example sets the pivot point to (0.5, 0.8) and moves the camera.


    Swift
    Objective-C




        let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
cameraUpdate.pivot = CGPoint(x: 0.5, y: 0.8)

mapView.moveCamera(cameraUpdate)





        Swift

          let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
cameraUpdate.pivot = CGPoint(x: 0.5, y: 0.8)

mapView.moveCamera(cameraUpdate)




        Objective-C

          NMFCameraUpdate *cameraUpdate = [NMFCameraUpdate cameraUpdateWithScrollTo:NMGLatLngMake(37.5666102, 126.9783881)];
cameraUpdate.pivot = CGPointMake(0.5, 0.8);

[self.mapView moveCamera:cameraUpdate];






Limitation of movement
With NMFMapView’s properties, you can restrict the camera movement to a specified area and set the maximum and minimum zoom level.
Minimum and maximum zoom level
The minZoomLevel and maxZoomLevel properties specify the minimum and maximum zoom levels of the camera.
The following code example limits the camera’s zoom level to the range, 5-18.


    Swift
    Objective-C




        mapView.minZoomLevel = 5.0
mapView.maxZoomLevel = 18.0





        Swift

          mapView.minZoomLevel = 5.0
mapView.maxZoomLevel = 18.0




        Objective-C

          self.mapView.minZoomLevel = 5.0;
self.mapView.maxZoomLevel = 18.0;






Camera area
The extent property restricts the camera’s target position to a specified area. Even if an API call is made to move the camera out of the specified area, the target position is adjusted to be within the area.
The following code example restricts the camera’s target position to areas near Korea.


    Swift
    Objective-C




        mapView.extent = NMGLatLngBounds(southWestLat: 31.43, southWestLng: 122.37, northEastLat: 44.35, northEastLng: 132)





        Swift

          mapView.extent = NMGLatLngBounds(southWestLat: 31.43, southWestLng: 122.37, northEastLat: 44.35, northEastLng: 132)




        Objective-C

          self.mapView.extent = NMGLatLngBoundsMake(31.43, 122.37, 44.35, 132);






When you restrict the camera area, it is recommended to set the minimum zoom level. Otherwise, the limited areas may be displayed too small when the map zooms out.

4-1.html.body:
User Interface
Users can interact with your map in various ways, such as controls and gestures. You can control the way users interact with your map, and handle UI events to provide proper feedback.
UI settings
NMFNaverMapView is a map view class that contains various pre-defined control UIs used in a map. Set NMFNaverMapView properties to control UI components including controls and user location tracking.
Controls
Controls are buttons on the map, which provide information of the map and simple manipulation features. The NAVER Maps SDK provides the following six controls:

Compass: Shows the camera’s rotation and tilt status. When users tap the compass, the camera’s heading and tilt are reset to 0. And when they are 0, the compass disappears automatically. Use the showCompass property to enable or disable the control.


Scale bar: Shows the map’s scale. It does not manipulate the map. Use the showScaleBar property to enable or disable the control.


Zoom button: When the button is tapped, the map’s zoom level increases or decreases by 1. Use the showZoomControls property to enable or disable the control.


Indoor map floor picker: Shows floor information of the indoor map that is being displayed. When a floor is selected, the indoor map of the floor is displayed. It appears only when an indoor map is displayed.
Use the showIndoorLevelPicker property to enable or disable the control.

Current location button: Shows the location tracking mode. When the button is tapped, the mode is changed. For more information, refer to Location.
Use the showLocationButton property to enable or disable the control.

NAVER logo: When it is tapped, a dialog box showing legends, legal notices and open source licenses appears. You cannot disable NAVER logo, but can adjust its location or disable tapping it. For apps using the NAVER Maps SDK, make sure that the NAVER logo is not covered by other UI elements.

Adjust the logo’s location by using logoAlign to set gravity, and logoMargin to set margins.
Use the logoInteractionEnabled property to enable or disable tapping the logo. If you disabled tapping the logo in your app, you must create a menu that links to the NAVER Maps SDK’s legal notice (-showLegalNotice) and open source license (-showOpenSourceLicense) views.




You can enable or disable each controller by changing its property. Disabled controls disappear from the screen.
The following code example disables the compass and enables the current location button.


    Swift
    Objective-C




        naverMapView.showCompass = false
naverMapView.showLocationButton = true





        Swift

          naverMapView.showCompass = false
naverMapView.showLocationButton = true




        Objective-C

          self.naverMapView.showCompass = NO;
self.naverMapView.showLocationButton = YES;






Gestures
Users can move the camera with various gestures including tap, drag and pinch. The NAVER Maps SDK provides the following five gestures:

Scroll: Drag the map with one or more fingers, and the camera moves following those fingers. Use the scrollGestureEnabled property to enable or disable the gesture.
Zoom: Double-tap the map, and the map’s zoom level increases by one level. Two-finger tap the map, and the zoom level decreases by one level. You can also use pinch, stretch, or one-finger zoom gesture to change the map’s zoom level. Use the zoomGestureEnabled property to enable or disable the gesture.
Tilt: Drag down or up the map with two fingers, and the map’s tilt angle is changed. Use the tiltGestureEnabled property to enable or disable the gesture.
Rotation: Rotate the map with two fingers, and the map’s bearing angle is changed. Use the rotateGestureEnabled property to enable or disable the gesture.
Stop: When you tap the map while the camera’s animation is in progress, the animation is cancelled and the camera stops at the current position. Use the stopGestureEnabled property to enable or disable the gesture.

By changing NMFMapView properties, you can enable or disable each gesture. If you want to show users the map that is neither tilted nor rotated only, you should not set the tilt or heading angle when moving the camera and should also disable gestures so that users cannot tilt or rotate the map.
The following code example disables tilt and rotate gestures.


    Swift
    Objective-C




        mapView.isTiltGestureEnabled = false
mapView.isRotateGestureEnabled = false





        Swift

          mapView.isTiltGestureEnabled = false
mapView.isRotateGestureEnabled = false




        Objective-C

          self.mapView.tiltGestureEnabled = NO;
self.mapView.rotateGestureEnabled = NO;






UI events
The NAVER Maps SDK provides various UI events in response to users’ tap. As touch events of a map extend UIGestureRecognizer, make sure that gesture events you want to add are not overlapped with them.
Tap maps
If a delegate is set to the NMFMapView.delegate property, the -didTapMapView:LatLng: delegate method is called when the map is tapped, with the screen coordinates and the map coordinates of the tapped position passed as a parameter.
The following code example displays the coordinates of the tapped position on the map.


    Swift
    Objective-C




        func didTapMapView(_ point: CGPoint, latLng latlng: NMGLatLng) {
    print("\(latlng.lat), \(latlng.lng)")
}





        Swift

          func didTapMapView(_ point: CGPoint, latLng latlng: NMGLatLng) {
    print("\(latlng.lat), \(latlng.lng)")
}




        Objective-C

          - (void)didTapMapView:(CGPoint)point LatLng:(NMGLatLng *)latlng {
    NSLog(@"%f, %f", latlng.lat, latlng.lng);
}






Tap symbols
The NAVER Maps SDK distinguishes between tapping symbols on the map and tapping the map itself. When a symbol is tapped, the -mapView:didTapSymbol: delegate method is called with the tapped symbol object passed as a parameter. You can get the tapped map view object and caption text from the symbol object.
A symbol tap event can be propagated to the map. To propagate the event to the map, you should make NMFMapView’s -mapView:didTapSymbol: return NO. Then, after the -mapView:didTapSymbol: returns NO, the -didTapMapView:LatLng: of the map is called. On the contrary, if the -mapView:didTapSymbol: returns YES, it is considered that the symbol consumes the event and thus the -mapView:didTapSymbol: of the map is not called.
The following code example displays a log saying “Seoul Metropolitan Government is tapped” when you tap the symbol with the caption text "Seoul Metropolitan Government," and a log saying “Map is tapped” when you tap other symbols or the map.


    Swift
    Objective-C




        func didTapMapView(_ point: CGPoint, latLng latlng: NMGLatLng) {
    print("Map is tapped")
}

func mapView(_ mapView: NMFMapView, didTap symbol: NMFSymbol) {
    if symbol.caption == "Seoul Metropolitan Government" {
        print("Seoul Metropolitan Government is tapped")
        return true

    } else {
        print("Symbol is tapped")
        return false
    }
}





        Swift

          func didTapMapView(_ point: CGPoint, latLng latlng: NMGLatLng) {
    print("Map is tapped")
}

func mapView(_ mapView: NMFMapView, didTap symbol: NMFSymbol) {
    if symbol.caption == "Seoul Metropolitan Government" {
        print("Seoul Metropolitan Government is tapped")
        return true

    } else {
        print("Symbol is tapped")
        return false
    }
}




        Objective-C

          - (void)didTapMapView:(CGPoint)point LatLng:(NMGLatLng *)latlng {
    NSLog(@"Map is tapped");
}

- (void)mapView:(NMFMapView *)mapView didTapSymbol:(NMFSymbol *)symbol {
    if ([symbol.caption isEqualToString:@"Seoul Metropolitan Government"]) {
        NSLog(@"Seoul Metropolitan Government is tapped");
        return YES;
    } else {
        NSLog(@"Symbol is tapped");
        return NO;
    }
}






Tap overlays
Like symbols, an overlay can receive a touch event, consume or propagate it. However, an overlay touch event is passed to each overly, unlike map or symbol touch events, and you should add an event handler to each overlay. Add overlayTouchHandler to an overlay’s touchHandler property to receive a touch event for the overlay. When the overlay is tapped, the block method specified in the overlayTouchHandler is called with the tapped overlay object passed as a parameter.
An overlay touch event can be propagated to the map. To propagate the event to the map, you should make overlayTouchHandler return NO. Then, after the block method is executed, the -didTapMapView:LatLng: of the map is called. On the contrary, if the overlayTouchHandler returns YES, it is considered that the overlay consumes the event and thus the -didTapMapView:LatLng: of the map is not called.
The following code example displays a log saying “Marker is touched” when a marker is tapped.


    Swift
    Objective-C




        marker.touchHandler = { (overlay: NMFOverlay) -> Bool in
    print("Marker is touched")
    return true // Consumes the event, and the didTapMapView event does not occur.
}





        Swift

          marker.touchHandler = { (overlay: NMFOverlay) -> Bool in
    print("Marker is touched")
    return true // Consumes the event, and the didTapMapView event does not occur.
}




        Objective-C

          marker.touchHandler = ^BOOL(NMFOverlay *overlay) {
    NSLog(@"Marker is touched");
    return YES; // Consumes the event, and the didTapMapView event does not occur.
};






Overlays can propagate an event only to the map. That is, even if there are multiple overlays or symbols overlapped under the overlay that triggers an event, it is not propagated to those overlays or symbols. When you tap an overlay that does not have the event listener added, the tap is ignored.  For example, if there are two overlays overlapped with each other and the one on top of the other does not have an event listener added, the other one receives a click event. If there is no overlapped overlay or an event listener is not added, it is considered that the map is tapped.

5-1.html.body:
Overlays
An overlay is an element visually representing geographical information, which you can freely place on your map. The NAVER Maps SDK provides various types of overlays, such as markers, info windows and shapes. For more information, refer to the documentation of each overlay.
Add and remove overlays
Create objects
All overlays except location overlays can be created just like a general class object.
The following code example creates a marker object.


    Swift
    Objective-C




        let marker = NMFMarker()





        Swift

          let marker = NMFMarker()




        Objective-C

          NMFMarker *marker = [NMFMarker new];






You can get a location overlay object, with the locationOverlay property of NMFMapView.
The following code example gets a location overlay object.


    Swift
    Objective-C




        let locationOverlay = mapView.locationOverlay





        Swift

          let locationOverlay = mapView.locationOverlay




        Objective-C

          NMFLocationOverlay *locationOverlay = self.mapView.locationOverlay;






Add overlays
All overlays except location overlays can be added to the map by specifying the mapView property. For information on how to add location overlays to the map, refer to Location Overlays.
The following code example adds a marker to the map.


    Swift
    Objective-C




        marker.mapView = mapView





        Swift

          marker.mapView = mapView




        Objective-C

          marker.mapView = self.mapView;






Besides the mapView property, you can also use the -openWithMarker: method, to open an info window for your map or markers.
The following code example adds an info window to a marker.


    Swift
    Objective-C




        infoWindow.open(with: marker)





        Swift

          infoWindow.open(with: marker)




        Objective-C

          [infoWindow openWithMarker:marker];






As the mapView is the property of an overlay, one overlay cannot be displayed on two or more maps at the same time. If you newly set the mapView property to an overlay that is already on the map, the overlay disappears from the previous map and appears on the new map.
Remove overlays
All overlays except location overlays can be removed from the map by setting the mapView property to nil. For information on how to remove location overlays from the map, refer to Location Overlays.
The following code example removes a marker from the map.


    Swift
    Objective-C




        marker.mapView = nil





        Swift

          marker.mapView = nil




        Objective-C

          marker.mapView = nil;






Besides the mapView property, you can also use the -close method to close an info window.
The following code example closes an info window.


    Swift
    Objective-C




        infoWindow.close();





        Swift

          infoWindow.close();




        Objective-C

          [infoWindow close];






Multithreading
An overlay object can be created by any thread. However, since an overlay’s properties are not thread-safe, they cannot be accessed simultaneously by multiple threads. In particular, properties of an overlay added to a map should be accessed by the main thread, otherwise NSObjectInaccessibleException occurs. Note that the exception does not occur even if other threads access the properties of the overlay that is not added to a map. 
Therefore, when handling a large number of overlays, you can use a background thread to create an object and set initial options while using the main thread only to add an overlay to the map for efficiency. The following code example creates 1,000 markers and set their properties in a background thread and adds them to the map.


    Swift
    Objective-C




        DispatchQueue.global(qos: .default).async {
    // Background thread
    var markers = [NMFMarker]()
    for index in 1...1000 {
        let marker = NMFMarker(position: ...)
        marker.iconImage = ...
        marker.captionText = ...
        markers.append(marker)
    }

    DispatchQueue.main.async { [weak self] in
        // Main thread
        for marker in markers {
            marker.mapView = self?.mapView
        }
    }
}





        Swift

          DispatchQueue.global(qos: .default).async {
    // Background thread
    var markers = [NMFMarker]()
    for index in 1...1000 {
        let marker = NMFMarker(position: ...)
        marker.iconImage = ...
        marker.captionText = ...
        markers.append(marker)
    }

    DispatchQueue.main.async { [weak self] in
        // Main thread
        for marker in markers {
            marker.mapView = self?.mapView
        }
    }
}




        Objective-C

          __block ViewController *weakSelf = self;
dispatch_async(dispatch_get_global_queue(DISPATCH_QUEUE_PRIORITY_DEFAULT, 0), ^{
    // Background thread
    NSMutableArray *markers = [NSMutableArray array];
    for (NSInteger i = 0; i 





Bitmap
Most overlays including markers, info windows, location overlays, ground overlays and path overlays use bitmap images. To use bitmap images for your overlays, you should create an NMFOverlayImage object.
Create NMFOverlayImage objects
NMFOverlayImage is an immutable class representing a bitmap image that can be used as an icon. Using the factory methods defined in the NMFOverlayImage class, you can create an instance from image assets, UIImage, and NSBundle. The list below describes some factory methods.

+overlayImageWithName:: Creates an object from the image asset with the specified name.
+overlayImageWithImage:: Creates an object from UIImage.
+overlayImageWithName:inBundle:: Creates an object by searching for an image with the specified name from the image asset in the specified bundle.

The following code example creates an NMFOverlayImage object from the image asset resource.


    Swift
    Objective-C




        let image = NMFOverlayImage(name: "marker_icon")





        Swift

          let image = NMFOverlayImage(name: "marker_icon")




        Objective-C

          NMFOverlayImage *image = [NMFOverlayImage overlayImageWithName:@"marker_icon"];






Set the NMFOverlayImage object in the property of the overlay that needs a bitmap, and the image is reflected. For more information, refer to the documentation of each overlay.
The following code example sets a marker icon.


    Swift
    Objective-C




        let image = NMFOverlayImage(name: "marker_icon")
marker.iconImage = image





        Swift

          let image = NMFOverlayImage(name: "marker_icon")
marker.iconImage = image




        Objective-C

          NMFOverlayImage *image = [NMFOverlayImage overlayImageWithName:@"marker_icon"];
marker.iconImage = image;






NMFOverlayImage using UIView
You can also create an NMFOverlayImage using a custom view. Implement an NMFOverlayImageDataSource protocol in a custom view to be used as an NMFOverlayImage, and add it as a dataSource of the NMFOverlay object to use.
Memory management
Since the NMFOverlayImage object handles bitmap images, you should carefully manage memory. If multiple overlays use the same image, only one NMFOverlayImage instance is needed.
The following code example shows a bad case where marker1 and marker2 share one bitmap image but marker3 and marker4 each have the same bitmap image.


    Swift
    Objective-C




        // Good: marker1 and 2 share the same bitmap.
let image = NMFOverlayImage(name: "marker_icon")
marker1.iconImage = image
marker2.iconImage = image

// Bad: marker3 and 4 each have the same bitmap.
marker3.iconImage = NMFOverlayImage(name: "marker_icon")
marker4.iconImage = NMFOverlayImage(name: "marker_icon")





        Swift

          // Good: marker1 and 2 share the same bitmap.
let image = NMFOverlayImage(name: "marker_icon")
marker1.iconImage = image
marker2.iconImage = image

// Bad: marker3 and 4 each have the same bitmap.
marker3.iconImage = NMFOverlayImage(name: "marker_icon")
marker4.iconImage = NMFOverlayImage(name: "marker_icon")




        Objective-C

          // Good: marker1 and 2 share the same bitmap.
NMFOverlayImage *image = NMFOverlayImage overlayImageWithName:@"marker_icon"];
marker1.iconImage = image;
marker2.iconImage = image;

// Bad: marker3 and 4 each have the same bitmap.
marker3.iconImage = [NMFOverlayImage overlayImageWithName:@"marker_icon"];
marker4.iconImage = [NMFOverlayImage overlayImageWithName:@"marker_icon"];






Note that if NMFOverlayImage objects are created from UIImage objects, and the NMFOverlayImage objects refer to the same UIImage, the instances share the same bitmap even if they are different.
The following code example shows a case where marker1, marker2, marker3, and marker4 share the same bitmap.


    Swift
    Objective-C




        // Good: marker1 and 2 share the same bitmap.
let image = NMFOverlayImage(image: bitmap)
marker1.iconImage = image
marker2.iconImage = image

// OK: marker3 and 4 each use different NMFOverlayImage objects but refer to the same resource, so they share the same bitmap.
marker3.iconImage = NMFOverlayImage(image: bitmap)
marker4.iconImage = NMFOverlayImage(image: bitmap)





        Swift

          // Good: marker1 and 2 share the same bitmap.
let image = NMFOverlayImage(image: bitmap)
marker1.iconImage = image
marker2.iconImage = image

// OK: marker3 and 4 each use different NMFOverlayImage objects but refer to the same resource, so they share the same bitmap.
marker3.iconImage = NMFOverlayImage(image: bitmap)
marker4.iconImage = NMFOverlayImage(image: bitmap)




        Objective-C

          // Good: marker1 and 2 share the same bitmap.
NMFOverlayImage *image = [NMFOverlayImage overlayImageWithImage:bitmap];
marker1.iconImage = image;
marker2.iconImage = image;

// OK: marker3 and 4 each use different OverlayImage objects but refer to the same resource, so they share the same bitmap.
marker3.iconImage = [NMFOverlayImage overlayImageWithImage:bitmap];
marker4.iconImage = [NMFOverlayImage overlayImageWithImage:bitmap];






If too many bitmap images are used for the map to handle, the map rendering becomes very slow with a log message saying "Overlay image atlas overflow" in the Xcode console. And if the memory usage is too high, the process will be terminated because of out of memory (OOM).
Stacking order of overlays
When multiple overlays are overlapped on the screen, an overlay with a higher stack order is displayed on top of those with lower stack orders. The stack order is specified depending on the type of an overlay by default, but can be changed.
Global z-index
The globalZIndex property specifies the stack order of an overlay. If globalZIndex is 0 or bigger, the overlay is drawn on top of symbols; if the property is smaller than 0, it is drawn beneath symbols. Note that an overlay is always drawn on top of the map background no matter how small globalZIndex is. The default globalZIndex values for each overlay type are as follows.

Info window: 400000
Location overlay: 300000
Marker: 200000
Arrowhead path overlay: 100000
(Map symbols)
Path: -100000
Shape (polygon, polyline, circle): -200000
Ground overlay: -300000
(Map background)

For example, a path is drawn on top of a shape, and beneath a symbol on the map by default. However, if the globalZIndex property of a path is set to 250000, it is drawn on top of markers and beneath a location overlay.
The following code example specifies the stacking order of three overlays, as polygon -> path -> marker. 


    Swift
    Objective-C




        polygon.globalZIndex = 150000
path.globalZIndex = 50000
marker.globalZIndex = -500000





        Swift

          polygon.globalZIndex = 150000
path.globalZIndex = 50000
marker.globalZIndex = -500000




        Objective-C

          polygon.globalZIndex = 150000;
path.globalZIndex = 50000;
marker.globalZIndex = -50000;







Local z-index
The zIndex property specifies the stack order of overlays with the same globalZIndex. If two overlays have the same globalZIndex value, an overlay with the higher zIndex is displayed on top of the other. For example, even if the zIndex of a marker is set to 1, and the zIndex of a ground overlay is set to 2, the marker is drawn on top of the ground overlay because the marker’s default globalZIndex is 200000, and that of the ground overlay is -300000. Since the default value of the zIndex property is 0 regardless of the type of an overlay, zIndex can be used more intuitively than globalZIndex to specify the stack order of overlays with the same type.
The following code example specifies the stacking order of three markers as yellow -> green -> blue. 


    Swift
    Objective-C




        yellowMarker.zIndex = 100
greenMarker.zIndex = 0
blueMarker.zIndex = -10





        Swift

          yellowMarker.zIndex = 100
greenMarker.zIndex = 0
blueMarker.zIndex = -10




        Objective-C

          yellowMarker.zIndex = 100;
greenMarker.zIndex = 0;
blueMarker.zIndex = -10;







Show and hide overlays
All overlays have the visibility and maximum/minimum zoom level properties. To hide an overlay temporarily or in a certain situation, use these properties, rather than the mapView property.
Visibility
Set hidden to YES to hide an overlay. The relation between the overlay and the map still remains the same.
The following code example hides an overlay.


    Swift
    Objective-C




        overlay.hidden = true





        Swift

          overlay.hidden = true




        Objective-C

          overlay.hidden = YES;






Minimum and maximum zoom levels
Use minZoom and maxZoom to show an overlay at a specified zoom level. If the camera’s zoom level is out of the range between the minZoom and the maxZoom, the overlay is hidden.
The following code example sets an overlay to be shown only at the levels, between 12 and 16.


    Swift
    Objective-C




        overlay.minZoom = 12
overlay.maxZoom = 16





        Swift

          overlay.minZoom = 12
overlay.maxZoom = 16




        Objective-C

          overlay.minZoom = 12;
overlay.maxZoom = 16;






Event
All overlays can receive and consume touch events. A touch event for overlays should be added to each overlay, not the map.
Touch event
Set overlayTouchHandler in the touchHandler property to receive a touch event for overlays. When an overlay is tapped, the block method implemented in the touchHandler is called with the tapped overlay object passed as a parameter.
The following code example sets a touch handler to display a log saying “Overlay is touched” whenever an overlay is tapped. 


    Swift
    Objective-C




        overlay.touchHandler = { (overlay: NMFOverlay) -> Bool in
    print("Overlay is touched")
    return true
}





        Swift

          overlay.touchHandler = { (overlay: NMFOverlay) -> Bool in
    print("Overlay is touched")
    return true
}




        Objective-C

          overlay.touchHandler =  ^BOOL(NMFOverlay *overlay) {
    NSLog(@"Overlay is touched");
    return YES;
};






Only one touch event listener can be added to an overlay. To remove the touch event listener, set the touchHandler property to nil.
The following code example removes the touch handler of an overlay.


    Swift
    Objective-C




        overlay.touchHandler = nil





        Swift

          overlay.touchHandler = nil




        Objective-C

          overlay.touchHandler = nil;






A touch handler should be added to every overlay which needs to receive events. If an overlay has no touch handler added, a tap on the overlay is ignored. For example, if there are two overlays overlapped with each other and the one on top of the other does not have a touch handler added, the other one receives a touch event. If there is no overlapped overlay or a touch handler is not added, it is considered that the map is tapped.
Propagate and consume events
An overlay touch event can be propagated to the map. To propagate an event to the map, you should make touchHandler return NO. After the touchHandler returns NO, the -didTapMapView:LatLng: delegate method of the map is called. On the contrary, if the touchHandler returns YES, it is considered that the overlay consumes the event and thus the -didTapMapView:LatLng: of the map is not called.
In the following code example, marker1 propagates touch events and marker2 consumes them. Whereas both log messages, “Marker is touched” and “Map is touched” are displayed when the marker1 is tapped, only the log message, “Marker 2 is touched” is displayed when the marker2 is tapped.


    Swift
    Objective-C




        marker1.touchHandler = { (overlay) -> Bool in
    print("Marker 1 is touched")
    // Propagates the event.
    return false
}

marker2.touchHandler = { (overlay) -> Bool in
    print("Marker 2 is touched")
    return true
}

func didTapMapView(_ point: CGPoint, latLng latlng: NMGLatLng) {
    print("Map is touched")
}





        Swift

          marker1.touchHandler = { (overlay) -> Bool in
    print("Marker 1 is touched")
    // Propagates the event.
    return false
}

marker2.touchHandler = { (overlay) -> Bool in
    print("Marker 2 is touched")
    return true
}

func didTapMapView(_ point: CGPoint, latLng latlng: NMGLatLng) {
    print("Map is touched")
}




        Objective-C

          marker1.touchHandler =  ^BOOL(NMFOverlay *overlay) {
    NSLog(@"Marker 1 is touched");
    // Propagates the event.
    return NO;
};

marker2.touchHandler =  ^BOOL(NMFOverlay *overlay) {
    NSLog(@"Marker 1 is touched");
    // Consumes the event.
    return YES;
};

- (void)didTapMapView:(CGPoint)point LatLng:(NMGLatLng*)latlng {
    NSLog(@"Map is touched");
}






Overlays can propagate an event only to the map. That is, even if there are multiple overlays or symbols overlapped under the overlay that triggers an event, it is not propagated to those overlays or symbols. 
userInfo
The userInfo property specifies additional information for an overlay. This property is useful especially when combined with a touch event handler. Since touchHandler can use the information saved in userInfo to identify which overlay is tapped, you can let multiple overlays share a touch handler.
The following code example adds userInfo to marker1 and marker2 to share a touch handler.


    Swift
    Objective-C




        let handler: overlayTouchHandler = { (overlay) -> Bool in
    print("Marker \(overlay.userInfo["tag"] ?? "tag") is touched")
    return false
}

marker1.userInfo = ["tag": 1]
marker2.userInfo = ["tag": 2]

marker1.touchHandler = handler
marker2.touchHandler = handler





        Swift

          let handler: overlayTouchHandler = { (overlay) -> Bool in
    print("Marker \(overlay.userInfo["tag"] ?? "tag") is touched")
    return false
}

marker1.userInfo = ["tag": 1]
marker2.userInfo = ["tag": 2]

marker1.touchHandler = handler
marker2.touchHandler = handler




        Objective-C

          overlayTouchHandler handler = ^BOOL(NMFOverlay *overlay) {
    NSLog(@"Marker %@ is touched", overlay.userInfo[@"tag"]);
    return NO;
};

marker1.userInfo = @{@"tag":@1};
marker2.userInfo = @{@"tag":@2};

marker1.touchHandler = handler;
marker2.touchHandler = handler;

